import styled from "styled-components";

export const HomeSection = styled.section`
  width: 100%;
  height: 100vh;
  backdrop-filter: blur(20px);
  -webkit-backdrop-filter: blur(20px);
  display: grid;
  grid-template-columns: 15% 85%;
  position: relative;
`
